import React from 'react';
import "../Asserts/Css/Pages/Home.css";
import IIEC_logo from "../Asserts/images/IIEC_logo.png";
import map from "../Asserts/images/Map.png";
import Header from '../Components/header';
import WhyStudyAbroad  from '../Components/header';
import Footer from '../Components/footer';
import StudyAbroad from '../Components/StudyAbroad';
import studyabroadintakesfull from '../Asserts/images/studyabroadintakesfull.png';
import mainpanelfull from '../Asserts/images/mainpanelfull.png';
import studyabroaadpanel from '../Asserts/images/studyabroaadpanel.png';
import employmentprospectsabroad from '../Asserts/images/employmentprospectsabroad.png';
import benefitsofstudyingabroad from '../Asserts/images/benefitsofstudyingabroad.png';
import studyabroadparentresources from '../Asserts/images/studyabroadparentresources.png';
import iiecsguidetostudyingabroad from '../Asserts/images/iiecsguidetostudyingabroad.png';
import offerletters from '../Asserts/images/offerletters.png';
import mainpanel from '../Asserts/images/mainpanel.png';
import lastdivfull from '../Asserts/images/lastdivfull.png';
import Paveyourpathtosuccess from '../Asserts/images/Paveyourpathtosuccess.png';
import Navbar from '../Components/navbar';



const Home =()=>{
   return (
      //  <Navbar></Navbar>
       <div className='homepage'>
       <Header></Header>
       
           <img className='images map'  src={map}></img>
         <div className='images mainpanelfull'>  <img  src={mainpanelfull}></img></div>
         <div className='images studyabroadimage'><StudyAbroad ></StudyAbroad></div>
         <div className='images'> <img src={studyabroaadpanel}></img></div>
        
          

          
          
         <div className='images'><img  src={studyabroadintakesfull}></img></div>
         <div className='images'> <img  src={employmentprospectsabroad}></img></div>
           <div className='images' ><img src={benefitsofstudyingabroad}></img></div>
           <div className='images'> <img  src={studyabroadparentresources}></img></div>
           <div className='images'> <img  src={iiecsguidetostudyingabroad}></img> </div>
           <div className='images'> <img  src={offerletters}></img> </div>
           <div className='images mainpanel'> <img  src={mainpanel}></img> </div>
           <div className='lastdivfull'> <img  src={lastdivfull}></img> </div>
           <div className='popular_courses'>
               <h1 className='coursesheading'>POPULAR COURSES</h1>
               <div className='coursesbox'><img className='pathtosucess' src={Paveyourpathtosuccess}></img><p className = 'titlesdiv'>Masters of Science</p></div>
               <div className='coursesbox'><img className='pathtosucess' src={Paveyourpathtosuccess}></img><p className = 'titlesdiv'>Masters </p></div>
               <div className='coursesbox'><img className='pathtosucess' src={Paveyourpathtosuccess}></img><p className = 'titlesdiv'>Engineering</p></div>
               <div className='coursesbox'><img className='pathtosucess' src={Paveyourpathtosuccess}></img><p className = 'titlesdiv'>Management</p></div>
           </div> 
           <h1 className='studentstestheading'>STUDENT'S TESTIMONIALS</h1>
           <div className='students_testimonial'>
              <div className='firstdivtestimonial'></div>
              <div className='seconddivtestimonial'></div>
              <div className='thirddivtestimonial'></div>
           </div>
         <div className='homefooter'><Footer></Footer></div>
         </div>
   )}
export default Home ;
